import React, { useEffect, useState } from "react";
import {
  Box,
  TextField,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Switch,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
  Typography
} from "@mui/material";
import { styled } from "@mui/material/styles";
import { Formik, Form, Field } from "formik";
import CloseIcon from "@mui/icons-material/Close";
import DeleteIcon from "@mui/icons-material/Delete";
import EditIcon from "@mui/icons-material/Edit";
import axios from "axios";
import InteviewPortal from "./InteviewPortal";

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": { padding: theme.spacing(2) },
  "& .MuiDialogActions-root": { padding: theme.spacing(1) }
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: "#1565c0",
    color: theme.palette.common.white,
    fontWeight: "bold",
    fontSize: 16
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14
  }
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover
  }
}));

const Categary = () => {
  const [checked, setChecked] = useState(true);
  const [open, setOpen] = useState(false);
  const [ini, setIni] = useState({ categoryName: "" });
  const [list, setList] = useState([]);
  const [editId, setEditId] = useState(null);
  const [searchCat, setSearchCat] = useState("");

  useEffect(() => { dataView(); }, []);

  const handleChange = (event) => { setChecked(event.target.checked); };
  const handleClickOpen = () => { setOpen(true); };
  const handleClose = () => { setOpen(false); };

  const handleSubmit = (values, { resetForm }) => {
    const url = editId
      ? `https://interviewback-ucb4.onrender.com/category/${editId}`
      : "https://interviewback-ucb4.onrender.com/category/create";
    const method = editId ? axios.patch : axios.post;
    
    method(url, values, {
      headers: { Authorization: "YOUR_AUTH_TOKEN" }
    })
      .then(() => { dataView(); })
      .catch(console.log);
    
    setIni({ categoryName: "" });
    setEditId(null);
    resetForm();
    handleClose();
  };

  const dataView = () => {
    axios.get("https://interviewback-ucb4.onrender.com/category/", {
      headers: { Authorization: "YOUR_AUTH_TOKEN" }
    })
      .then((res) => { setList(res.data.data); })
      .catch(console.log);
  };

  const deleteData = (id) => {
    axios.delete(`https://interviewback-ucb4.onrender.com/category/${id}`, {
      headers: { Authorization: "YOUR_AUTH_TOKEN" }
    })
      .then(() => { dataView(); })
      .catch(console.log);
  };

  const searchCategory = (e) => {
    setSearchCat(e.target.value);
    axios.get(`https://interviewback-ucb4.onrender.com/category/?search=${e.target.value}`, {
      headers: { Authorization: "YOUR_AUTH_TOKEN" }
    })
      .then((res) => { setList(res.data.data); })
      .catch(console.log);
  };

  const editData = (id, row) => {
    handleClickOpen();
    setIni(row);
    setEditId(id);
  };

  return (
    <InteviewPortal>
      <Box sx={{ display: "flex", flexWrap: "wrap" }}>
        <TextField select label="Search Category" sx={{ flex: 1 }} onChange={searchCategory}>
          {list.map((option) => (
            <MenuItem key={option._id} value={option.categoryName}>
              {option.categoryName}
            </MenuItem>
          ))}
        </TextField>
        <Button
          sx={{ backgroundColor: "#1565c0", color: "white", marginLeft: 2 }}
          onClick={handleClickOpen}
        >
          ADD CATEGORY
        </Button>
      </Box>

      <BootstrapDialog onClose={handleClose} open={open}>
        <DialogTitle>Add Category</DialogTitle>
        <IconButton onClick={handleClose} sx={{ position: "absolute", right: 8, top: 8 }}>
          <CloseIcon />
        </IconButton>
        <Formik enableReinitialize initialValues={ini} onSubmit={handleSubmit}>
          <Form>
            <DialogContent>
              <Field as={TextField} name="categoryName" label="Category" fullWidth />
            </DialogContent>
            <DialogActions>
              <Button sx={{ backgroundColor: "#1565c0", color: "white" }} type="submit">
                Submit
              </Button>
            </DialogActions>
          </Form>
        </Formik>
      </BootstrapDialog>

      <TableContainer component={Paper} sx={{ marginTop: 3 }}>
        <Table>
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell align="left">Category Name</StyledTableCell>
              <StyledTableCell align="right">Status</StyledTableCell>
              <StyledTableCell align="right">Delete</StyledTableCell>
              <StyledTableCell align="right">Update</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list.map((row, i) => (
              <StyledTableRow key={row._id}>
                <StyledTableCell>{i + 1}</StyledTableCell>
                <StyledTableCell align="left">{row.categoryName}</StyledTableCell>
                <StyledTableCell align="right">
                  <Switch checked={checked} onChange={handleChange} />
                </StyledTableCell>
                <StyledTableCell align="right">
                  <IconButton onClick={() => deleteData(row._id)} color="error"><DeleteIcon /></IconButton>
                </StyledTableCell>
                <StyledTableCell align="right">
                  <IconButton onClick={() => editData(row._id, row)} color="primary"><EditIcon /></IconButton>
                </StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default Categary;
